import React from 'react';
import './App.css';
import { createTheme, ThemeProvider } from '@material-ui/core';
import Pomodoro from './components/Pomodoro';

const theme = createTheme({
  palette:{
    primary: {
      main: '#05445E'
    },

    secondary:{
      main: '#189AB4'
    }
  }
})

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div>
        <Pomodoro/>
      </div>
    </ThemeProvider>
  );
}

export default App;
